import React from 'react';
import Main from './pages/index/Main';

import { ThemeProvider, createMuiTheme } from '@material-ui/core/styles';

const theme = createMuiTheme({
	palette: {
		primary: {
			main: '#fff',
		},
	},
	typography: {
		fontFamily: 'TizTypeFont',
	},
});

const App = props => {
	return <Main />;
};

export default App;
